  false,\n\t\"url\": null,\n\t\"notes\": \"EMS Locations in Kansas The EMS stations
  dataset consists of any location where emergency medical services (EMS) personnel
  are stationed or based out of, or where equipment that such personnel use in carrying
  out their jobs is stored for ready use. Ambulance services are included even if
  they only provide transportation services, but not if they are located at, and operated
  by, a hospital. If an independent ambulance service or EMS provider happens to be
  collocated with a hospital, it will be included in this dataset. The dataset includes
  both private and governmental entities. This dataset is comprised completely of
  license free data. The Fire Station dataset and the EMS dataset were merged into
  one working file. TGS processed as one file and then separated for delivery purposes.
  Records with \"-DOD\" appended to the end of the [NAME] value are located on a military
  base, as defined by the Defense Installation Spatial Data Infrastructure (DISDI)
  military installations and military range boundaries. Text fields in this dataset
  have been set to all upper case to facilitate consistent database engine search
  results. All diacritics (e.g., the German umlaut or the Spanish tilde) have been
  replaced with their closest equivalent English character to facilitate use with
  database systems that may not support diacritics. The currentness of this dataset
  is indicated by the [CONTDATE] field. Based upon this field, the oldest record dates
  from 10/16/2006 and the newest record dates from 08/11/2008\",\n\t\"license_title\":
